import React from "react";
import { Typography, Space, Row, Col, Button } from "antd";
import { useRouter } from "next/router";
const { Text } = Typography;

const Home = () => {
	const router = useRouter();

	const toDog = () => {
		router.push("/dog");
	};

	const toCat = () => {
		router.push("/cat");
	};

	return (
		<>
			<Row justify="center">
				<Col span={12}>
					<Text
						strong
						style={{ justify: "center", textAlign: "center" }}
					>
						강아지
					</Text>
				</Col>
				<Col span={12}>
					<Text strong>고양이</Text>
				</Col>
			</Row>

			<Row justify="center">
				<Col span={12}>
					<Button type="link" onClick={toDog}>
						<img
							style={{
								display: "block",
								marginLeft: "auto",
								marginRight: "auto",
								width: "100%",
								height: "auto",
							}}
							src={require("../assets/dog.png")}
						/>
					</Button>
				</Col>
				<Col span={12}>
					<Button type="link" onClick={toCat}>
						<img
							style={{
								display: "block",
								marginLeft: "auto",
								marginRight: "auto",
								width: "100%",
							}}
							src={require("../assets/cat.png")}
						/>
					</Button>
				</Col>
			</Row>
		</>
	);
};

export default Home;
